import React from 'react';

const PersonasLista = (props) => {
    
    
    return (
        <div>
            <ul className="collection with-header">
                <li className="collection-header"><h4>Contactos</h4></li>
                
                {
                    props.listaPersonas.map((element)=>{
                        return (
                            <li className="collection-item" 
                                key={element._id}
                                onClick={props.actualizarPersona.bind(this, element)}
                                style={{
                                    'cursor': 'pointer'
                                }}
                            >{element.nombre} {element.apellido}</li>

                        )
                    })
                }
  <a class="waves-effect waves-light btn modal-trigger" href="#modal1">Modal</a>

  <div id="modal1" class="modal">
    <div class="modal-content">
      <h4>Modal Header</h4>
      <p>A bunch of text</p>
    </div>
    <div class="modal-footer">
      <a href="#!" class="modal-close waves-effect waves-green btn-flat">Agree</a>
    </div>
  </div>
            </ul>
        </div>
    )
}

export default PersonasLista;
